import React from 'react'

function Person({person, selectedPerson}){
    const {First_Name, Last_Name, Sex, RegNumber, Program, Postion} = person

    const onSelect = () => {
        selectedPerson(person)
    }
    return (
        <button onClick={onSelect} type="button" class="list-group-person list-group-person-action">
            {First_Name} {Last_Name} {Sex} {RegNumber} {Program} {Postion}
         </button>
    )
}

export default Person
